  var tube = makeImg('data:image/png;base64,');
  var curs = makeImg('data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABAAAAAQCAYAAAAf8/9hAAAABmJLR0QAAAAAAAD5Q7t/AAAACXBIWXMAAA3XAAAN1wFCKJt4AAAAB3RJTUUH3gcCDygYuaSypQAAAGFJREFUOMvdk0EKgDAMBGe0+P//WowXCyKtUooI7ikQspkkBAYlQEREI78AK1DNq07tWgC2J4KkUkxU70iLzsTT6A6+N0i1GXsal2DuNIgrQe4kKQb+6Ao0fsJjwfk1gmHthPEZHlJZHcQAAAAASUVORK5CYII=');

